I assist clients on a wide range of general employment, workplace health and safety and industrial relations issues, including: 

•	advising on employment agreements, policies and procedures;
•	advising on all facets of the Work Health and Safety Act 2011 (Qld) (major hazard facilities, compliance work, incident response and prosecutions);
•	advising on all facets of the energy and resources safety legislation (petroleum and gas, coal mining and metalliferous mining); 
•	advising on the interface between the Petroleum and Gas (Production and Safety) Act 2004 (Qld) and the Work Health and Safety Act 2011 (Qld); 
•	advising on the onshore-offshore obligations of petroleum and gas works;
•	advising on termination and redundancy issues; 
•	advising on industrial relations matters; and
•	preparation for coronial inquests; and 
•	litigation preparation for unfair dismissal, personal injury and adverse action claims.

