Melissa works in the Litigation and Dispute Resolution group where she has wide ranging experience in general commercial litigation matters in the Supreme, District and Federal court jurisdictions. 

Melissa's general experience includes:

-litigation proceedings in the Supreme, District and Federal court jurisdictions in respect of contractual, construction, intellectual property and banking and finance matters including conducting trials in such jurisdictions;
-representing and advising franchisors in recovering debts from franchisees, as well as advising on strategies to exit franchisees;
-enforcement of intellectual property rights;
-defamation claims;
-claims for misleading and deceptive conduct and unconscionable conduct;
-general contractual claims;
-acting for both landlords and tenants in leasing disputes;
-advising property developers with respect to advertising materials and compliance under the ACL;
-dispute resolution processes such as mediation; and
-providing general legal assistance as a volunteer through the firm's pro bono program to the homeless and disadvantaged at the QPILCH Homeless Persons Legal Clinic.

